    event.preventDefault();
    console.log(data);
  }

  return (
    <div>
      <form>
        <input
          type="text"
          className={style.mainInput}
          placeholder="Task Name"
        />
        <button
          className={style.submitButton}
          type="submit"
          onClick={handleFormSumbit}
        >
          Submit
        </button>
      </form>
    </div>
  );
}

export default TodoForm;
